import React from 'react';
import { Text,  ScrollView,View, ImageBackground,TouchableOpacity, Button , SafeAreaView, Alert} from 'react-native';
import styles from './style';

// import Fundo from '../../assets/homepage.png';


const Separator = () => (
  <View style={styles.separator} />
);


function Home({navigation}){


  return (
    <View style={styles.caixa}>     



      <SafeAreaView style={styles.container}>

           {/* <ImageBackground source={Fundo} style={styles.fundo}> */}
      <ImageBackground style={styles.fundo}>

        <View> 

          <TouchableOpacity style={styles.btn} onPress={()=>{navigation.navigate('Login')}}>

            <Text style={styles.texto}> JOGAR </Text>
          </TouchableOpacity>

        </View>

      </ImageBackground>
        <View>
          <Text style={styles.title}>
            The title and onPress handler are required. It is recommended to set accessibilityLabel to help make your app usable by everyone.
          </Text>
          {/* <Button
            title="Press me"
            onPress={() => Alert.alert('Simple Button pressed')}
          /> */}
        </View>
        <Separator />
        {/* <View>
          <Text style={styles.title}>
            Adjust the color in a way that looks standard on each platform. On  iOS, the color prop controls the color of the text. On Android, the color adjusts the background color of the button.
          </Text>
          <Button
            title="Press me"
            color="#f194ff"
            onPress={() => Alert.alert('Button with adjusted color pressed')}
          />
        </View> */}
        <Separator />
        {/* <View>
          <Text style={styles.title}>
            All interaction for the component are disabled.
          </Text>
          <Button
            title="Press me"
            disabled
            onPress={() => Alert.alert('Cannot press this one')}
          />
        </View> */}
        <Separator />
        <View>
          <Text style={styles.title}>
            This layout strategy lets the title define the width of the button.
          </Text>
          <View style={styles.fixToText}>
            <Button
              title="Left button"
              // onPress={() => Alert.alert('Left button pressed')}
            />
            <Button
              title="Login"
              onPress={()=>{navigation.navigate('Login')}}
            />
          </View>
        </View>
      </SafeAreaView>

    </View>
  )



}
export default Home;
